import React, { Component } from "react";

class Personal extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <form>
          <label for="firstName">First name</label>
          <input id="firstName"></input>
          <input id="lastName"></input>
        </form>
      </div>
    );
  }
}

export default Personal;
